import{_ as a,e as r}from"./app.9b9045f0.js";const e={},i=r('<h1 id="kafka" tabindex="-1"><a class="header-anchor" href="#kafka" aria-hidden="true">#</a> Kafka</h1><p>Kafka\u5C5E\u4E8E\u5206\u5E03\u5F0F\u7684\u6D88\u606F\u5F15\u64CE\u7CFB\u7EDF\uFF0C\u5B83\u7684\u4E3B\u8981\u529F\u80FD\u662F\u63D0\u4F9B\u4E00\u5957\u5B8C\u5907\u7684\u6D88\u606F\u53D1\u5E03\u4E0E\u8BA2\u9605\u89E3\u51B3\u65B9\u6848\u3002</p><h3 id="kafka\u5DE5\u4F5C\u6D41\u7A0B" tabindex="-1"><a class="header-anchor" href="#kafka\u5DE5\u4F5C\u6D41\u7A0B" aria-hidden="true">#</a> Kafka\u5DE5\u4F5C\u6D41\u7A0B</h3><p><strong>\u4E3B\u9898\uFF08Topic\uFF09</strong>\uFF1A\u53D1\u5E03\u8BA2\u9605\u7684\u5BF9\u8C61\uFF0C\u627F\u8F7D\u6D88\u606F\u7684\u903B\u8F91\u5BB9\u5668\uFF0C\u4E3B\u8981\u7528\u6765\u533A\u5206\u5177\u4F53\u7684\u4E1A\u52A1\u3002</p><p><strong>\u751F\u4EA7\u8005\uFF08Product\uFF09</strong>\uFF1A\u5411\u4E3B\u9898\u53D1\u9001\u6D88\u606F\u7684\u5BA2\u6237\u7AEF\u5E94\u7528\u7A0B\u5E8F\u3002</p><p><strong>\u6D88\u8D39\u8005\uFF08Consumer\uFF09</strong>\uFF1A\u8BA2\u9605\u4E3B\u9898\u6D88\u606F\u7684\u5BA2\u6237\u7AEF\u5E94\u7528\u7A0B\u5E8F\u3002</p><p><strong>Broker</strong>\uFF1A\u6784\u6210Kafka\u670D\u52A1\u5668\u7AEF\u7684\u670D\u52A1\u8FDB\u7A0B\uFF0C\u4E00\u4E2AKafka\u96C6\u7FA4\u7531\u591A\u4E2ABroker\u7EC4\u6210\uFF0CBroker\u8D1F\u8D23\u63A5\u6536\u548C\u5904\u7406\u5BA2\u6237\u7AEF\u53D1\u9001\u8FC7\u6765\u7684\u8BF7\u6C42\uFF0C\u4EE5\u53CA\u5BF9\u6D88\u606F\u8FDB\u884C\u6301\u4E45\u5316\u3002\u53EF\u5C06Broker\u5206\u6563\u8FD0\u884C\u5728\u4E0D\u540C\u7684\u673A\u5668\u4E0A\uFF0C\u4EE5\u5B9E\u73B0Kafka\u7684\u9AD8\u53EF\u7528\u3002</p><p><strong>Replica</strong>\uFF1A\u526F\u672C\u3002\u5B9E\u73B0\u9AD8\u53EF\u7528\u7684\u53E6\u4E00\u4E2A\u624B\u6BB5\u5C31\u662F\u5907\u4EFD\u673A\u5236\u3002\u5907\u4EFD\u5C31\u662F\u5C06\u76F8\u540C\u7684\u6570\u636E\u62F7\u8D1D\u5230\u591A\u53F0\u673A\u5668\u4E0A\uFF0C\u800C\u8FD9\u4E9B\u76F8\u540C\u7684\u6570\u636E\u62F7\u8D1D\u5728Kafka\u4E2D\u88AB\u79F0\u4E3A\u526F\u672C\u3002\u526F\u672C\u7684\u6570\u91CF\u53EF\u914D\u7F6E\uFF0C\u5206\u4E3A\u4E24\u7C7B\uFF1A<strong>\u9886\u5BFC\u8005\u526F\u672C\u548C\u8FFD\u968F\u8005\u526F\u672C</strong>\u3002\u524D\u8005\u5BF9\u5916\u63D0\u4F9B\u670D\u52A1\uFF0C\u800C\u540E\u8005\u53EA\u662F\u88AB\u52A8\u5730\u8FFD\u968F\u9886\u5BFC\u8005\u526F\u672C\u800C\u5DF2\uFF0C\u4E0D\u80FD\u4E0E\u5916\u754C\u8FDB\u884C\u4EA4\u4E92\u3002</p><p>\u526F\u672C\u7684\u5DE5\u4F5C\u673A\u5236\uFF1A\u751F\u4EA7\u8005\u603B\u662F\u5411\u9886\u5BFC\u8005\u526F\u672C\u5199\u6D88\u606F\uFF0C\u6D88\u8D39\u8005\u603B\u662F\u5411\u9886\u5BFC\u8005\u526F\u672C\u8BFB\u6D88\u606F\u3002\u800C\u8FFD\u968F\u8005\u526F\u672C\uFF0C\u5B83\u53EA\u662F\u5411\u9886\u5BFC\u8005\u526F\u672C\u53D1\u9001\u8BF7\u6C42\uFF0C\u8BF7\u6C42\u9886\u5BFC\u8005\u526F\u672C\u628A\u6700\u65B0\u7684\u6D88\u606F\u53D1\u7ED9\u5B83\uFF0C\u8FD9\u6837\u5B83\u5C31\u80FD\u4FDD\u6301\u4E0E\u9886\u5BFC\u8005\u7684\u540C\u6B65\u3002</p><p><strong>\u5206\u533A\uFF08Partitioning\uFF09</strong>\uFF1AKafka\u4E2D\u7684\u5206\u533A\u673A\u5236\u6307\u7684\u662F\u5C06\u6BCF\u4E2A\u4E3B\u9898\u5212\u5206\u6210\u591A\u4E2A\u5206\u533A\uFF0C\u6BCF\u4E2A\u5206\u533A\u662F\u4E00\u7EC4\u6709\u5E8F\u7684\u6D88\u606F\u65E5\u5FD7\u3002\u751F\u4EA7\u8005\u751F\u4EA7\u7684\u6BCF\u6761\u6D88\u606F\u53EA\u4F1A\u88AB\u53D1\u9001\u5230\u4E00\u4E2A\u5206\u533A\u4E2D\u3002\u5982\u679C\u5411\u4E00\u4E2A\u53CC\u5206\u533A\u7684\u4E3B\u9898\u53D1\u9001\u4E00\u6761\u6D88\u606F\uFF0C\u8FD9\u6761\u6D88\u606F\u8981\u4E48\u5728\u5206\u533A0\u4E2D\uFF0C\u8981\u4E48\u5728\u5206\u533A1\u4E2D\u3002\u5206\u533A\u673A\u5236\u4FDD\u8BC1\u4E86Kafka\u7684\u4F38\u7F29\u6027\u3002</p><p>\u5206\u533A\u4E0E\u526F\u672C\u7684\u8054\u7CFB\uFF1A\u5B9E\u9645\u4E0A\uFF0C\u526F\u672C\u662F\u5728\u5206\u533A\u8FD9\u4E2A\u5C42\u7EA7\u5B9A\u4E49\u4E0B\u7684\u3002\u6BCF\u4E2A\u5206\u533A\u4E0B\u53EF\u4EE5\u914D\u7F6E\u82E5\u5E72\u4E2A\u526F\u672C\uFF0C\u5176\u4E2D\u53EA\u80FD\u67091\u4E2A\u9886\u5BFC\u8005\u526F\u672C\u548CN-1\u4E2A\u8FFD\u968F\u8005\u526F\u672C\u3002\u751F\u4EA7\u8005\u5411\u5206\u533A\u5199\u5165\u6D88\u606F\uFF0C\u6BCF\u6761\u6D88\u606F\u5728\u5206\u533A\u4E2D\u7684\u4F4D\u7F6E\u4FE1\u606F\u7531\u4E00\u4E2A\u53EB\u4F4D\u79FB\uFF08Offset\uFF09\u7684\u6570\u636E\u6765\u8868\u793A\u3002</p><h4 id="kafka\u7684\u4E09\u5C42\u67B6\u6784" tabindex="-1"><a class="header-anchor" href="#kafka\u7684\u4E09\u5C42\u67B6\u6784" aria-hidden="true">#</a> Kafka\u7684\u4E09\u5C42\u67B6\u6784</h4><ul><li>\u7B2C\u4E00\u5C42\u662F\u4E3B\u9898\u5C42\uFF0C\u6BCF\u4E2A\u4E3B\u9898\u53EF\u4EE5\u914D\u7F6EN\u4E2A\u5206\u533A\uFF0C\u800C\u6BCF\u4E2A\u5206\u533A\u53C8\u53EF\u4EE5\u914D\u7F6EN\u4E2A\u526F\u672C\u3002</li><li>\u7B2C\u4E8C\u5C42\u662F\u5206\u533A\u5C42\uFF0C\u6BCF\u4E2A\u5206\u533A\u7684N\u4E2A\u526F\u672C\u4E2D\u53EA\u80FD\u6709\u4E00\u4E2A\u5145\u5F53\u9886\u5BFC\u8005\u7684\u89D2\u8272\uFF0C\u5176\u4ED6\u526F\u672C\u662F\u8FFD\u968F\u8005\u526F\u672C\uFF0C\u53EA\u63D0\u4F9B\u6570\u636E\u5197\u4F59\u4F5C\u7528\u3002</li><li>\u7B2C\u4E09\u5C42\u662F\u6D88\u606F\u5C42\uFF0C\u5206\u533A\u4E2D\u5305\u542B\u82E5\u5E72\u6761\u6D88\u606F\uFF0C\u6BCF\u6761\u6D88\u606F\u7684\u4F4D\u79FB\u4ECE0\u5F00\u59CB\uFF0C\u4E00\u6B21\u9012\u589E\u3002</li><li>\u6700\u540E\uFF0C\u5BA2\u6237\u7AEF\u7A0B\u5E8F\u53EA\u80FD\u4E0E\u5206\u533A\u9886\u5BFC\u8005\u526F\u672C\u8FDB\u884C\u4EA4\u4E92\u3002</li></ul><h4 id="\u6301\u4E45\u5316\u6570\u636E" tabindex="-1"><a class="header-anchor" href="#\u6301\u4E45\u5316\u6570\u636E" aria-hidden="true">#</a> \u6301\u4E45\u5316\u6570\u636E</h4><p>Kafka\u5728Broker\u4E2D\u6301\u4E45\u5316\u6570\u636E\u3002Kafka\u4F7F\u7528\u6D88\u606F\u65E5\u5FD7\uFF08Log\uFF09\u6765\u4FDD\u5B58\u6570\u636E\uFF0C\u4E00\u4E2A\u65E5\u5FD7\u5C31\u662F\u78C1\u76D8\u4E0A\u4E00\u4E2A\u53EA\u80FD\u8FFD\u52A0\u5199\u6D88\u606F\u7684\u7269\u7406\u6587\u4EF6\u3002\u56E0\u4E3A\u53EA\u80FD\u8FFD\u52A0\u5199\u5165\uFF0C\u6545\u907F\u514D\u4E86\u7F13\u6162\u7684\u968F\u673AI/O\u5199\u64CD\u4F5C\uFF0C\u6539\u4E3A\u6027\u80FD\u8F83\u597D\u7684\u987A\u5E8FI/O\u5199\u64CD\u4F5C\uFF0C\u8FD9\u4E5F\u662F\u5B9E\u73B0Kafka\u9AD8\u541E\u5410\u91CF\u7684\u4E00\u4E2A\u91CD\u8981\u624B\u6BB5\u3002\u4E0D\u8FC7\u5982\u679C\u4E0D\u505C\u5730\u5411\u4E00\u4E2A\u65E5\u5FD7\u5199\u5165\u6D88\u606F\uFF0C\u6700\u7EC8\u4E5F\u4F1A\u8017\u5C3D\u78C1\u76D8\u7A7A\u95F4\uFF0C\u6240\u4EE5\uFF0CKafka\u4F1A\u5B9A\u65F6\u671F\u5730\u5220\u9664\u6D88\u606F\u4EE5\u56DE\u6536\u78C1\u76D8\u7A7A\u95F4\u3002</p><p><strong>Kafka\u5982\u4F55\u5220\u9664\u6D88\u606F</strong></p><p>\u7B80\u5355\u6765\u8BF4\uFF0C\u5C31\u662F\u901A\u8FC7\u65E5\u5FD7\u6BB5\uFF08Log Segment\uFF09\u673A\u5236\u3002\u5728Kafka\u5E95\u5C42\uFF0C\u4E00\u4E2A\u65E5\u5FD7\u53C8\u8FDB\u4E00\u6B65\u7EC6\u5206\u6210\u591A\u4E2A\u65E5\u5FD7\u6BB5\uFF0C\u6D88\u606F\u88AB\u8FFD\u52A0\u5199\u5230\u6700\u65B0\u7684\u65E5\u5FD7\u6BB5\uFF0C\u5F53\u4E00\u4E2A\u65B0\u7684\u65E5\u5FD7\u6BB5\u5199\u6EE1\u540E\uFF0CKafka\u4F1A\u81EA\u52A8\u5207\u5206\u51FA\u4E00\u4E2A\u65B0\u7684\u65E5\u5FD7\u6BB5\uFF0C\u5E76\u5C06\u8001\u7684\u65E5\u5FD7\u6BB5\u5C01\u5B58\u8D77\u6765\uFF0C\u518D\u901A\u8FC7\u5B9A\u65F6\u4EFB\u52A1\u5B9A\u671F\u5730\u68C0\u67E5\u8001\u7684\u65E5\u5FD7\u6BB5\u662F\u5426\u80FD\u591F\u88AB\u5220\u9664\uFF0C\u4ECE\u800C\u5B9E\u73B0\u56DE\u6536\u78C1\u76D8\u7A7A\u95F4\u7684\u76EE\u7684\u3002</p><h4 id="\u6D88\u8D39\u8005\u6A21\u578B" tabindex="-1"><a class="header-anchor" href="#\u6D88\u8D39\u8005\u6A21\u578B" aria-hidden="true">#</a> \u6D88\u8D39\u8005\u6A21\u578B</h4><p>\u6D88\u606F\u6A21\u578B\u6709\u4E24\u79CD\uFF1A</p><ul><li>\u70B9\u5BF9\u70B9\u6A21\u578B\uFF1A\u540C\u4E00\u6761\u6D88\u606F\u53EA\u80FD\u88AB\u4E00\u4E2A\u6D88\u8D39\u8005\u6D88\u8D39</li><li>\u53D1\u5E03\u8BA2\u9605\u6A21\u578B\uFF1A\u751F\u4EA7\u53D1\u5E03\u5B8C\u6D88\u606F\u540E\uFF0C\u7531\u591A\u4E2A\u6D88\u8D39\u8005\u8BA2\u9605</li></ul><p>Kafka\u4E2D\u5B9E\u73B0\u70B9\u5BF9\u70B9\u6A21\u578B\u7684\u65B9\u5F0F\u662F\u4F7F\u7528<strong>\u6D88\u8D39\u8005\u7EC4</strong>\u3002\u6240\u8C13\u6D88\u8D39\u8005\u7EC4\uFF0C\u6307\u7684\u662F\u5C06\u591A\u4E2A\u6D88\u8D39\u8005\u5B9E\u4F8B\u5171\u540C\u7EC4\u6210\u4E00\u4E2A\u7EC4\u6765\u6D88\u8D39\u4E00\u7EC4\u4E3B\u9898\u3002\u8FD9\u7EC4\u4E3B\u9898\u4E2D\u7684\u6BCF\u4E2A\u6D88\u606F\u53EA\u80FD\u88AB\u6D88\u8D39\u8005\u7EC4\u4E2D\u7684\u4E00\u4E2A\u5B9E\u4F8B\u6D88\u8D39\u3002\u5F15\u5165\u6D88\u8D39\u8005\u7EC4\u7684\u76EE\u7684\u4E3B\u8981\u662F\u4E3A\u4E86\u63D0\u5347\u6D88\u8D39\u8005\u7AEF\u7684\u541E\u5410\u91CF\u3002\u591A\u4E2A\u6D88\u8D39\u8005\u5B9E\u4F8B\u540C\u65F6\u6D88\u8D39\uFF0C\u52A0\u901F\u6574\u4E2A\u6D88\u8D39\u7AEF\u7684\u541E\u5410\u91CF\uFF08TPS\uFF09\u3002\u6D88\u8D39\u8005\u7EC4\u4E2D\u7684\u6240\u6709\u6D88\u8D39\u8005\u5B9E\u4F8B\u4E0D\u4EC5\u80FD\u5171\u540C\u6D88\u8D39\u6D88\u606F\uFF0C\u8FD8\u80FD\u5F7C\u6B64\u534F\u4F5C\u3002\u5047\u8BBE\u7EC4\u5185\u67D0\u4E2A\u6D88\u8D39\u8005\u5B9E\u4F8B\u6302\u6389\u4E86\uFF0CKafka\u80FD\u591F\u81EA\u52A8\u68C0\u6D4B\u5230\uFF0C\u7136\u540E\u628A\u8FD9\u4E2A\u5B9E\u4F8B\u4E4B\u524D\u8D1F\u8D23\u7684\u5206\u533A\u8F6C\u79FB\u7ED9\u5176\u4ED6\u7684\u6D88\u8D39\u8005\u3002\u8FD9\u4E2A\u8FC7\u7A0B\u5C31\u662FKafka\u7684<strong>\u91CD\u5E73\u8861</strong>\uFF08Rebalance\uFF09\u3002</p><p>\u6D88\u8D39\u8005\u6D88\u8D39\u6D88\u606F\u7684\u8FC7\u7A0B\u4E2D\u9700\u8981\u6709\u4E2A\u5B57\u6BB5\u6765\u8BB0\u5F55\u5B83\u5F53\u524D\u6D88\u8D39\u7684\u4F4D\u7F6E\uFF0C\u8FD9\u4E2A\u5B57\u6BB5\u5C31\u662F\u6D88\u8D39\u8005\u4F4D\u79FB\u3002\u6CE8\u610F\u4E0E\u5206\u533A\u4F4D\u79FB\u7684\u533A\u522B\uFF0C\u5206\u533A\u4F4D\u79FB\u6307\u7684\u662F\u6D88\u606F\u5199\u5165\u5206\u533A\u7684\u4F4D\u7F6E\uFF0C\u5B83\u7684\u4F4D\u503C\u662F\u56FA\u5B9A\u7684\u3002\u800C\u6D88\u8D39\u8005\u4F4D\u79FB\u662F\u968F\u65F6\u53D8\u5316\u7684\uFF0C\u6BD5\u7ADF\u5B83\u662F\u6D88\u606F\u8005\u6D88\u8D39\u6D88\u606F\u7684\u6307\u793A\u5668\u3002\u6BCF\u4E2A\u6D88\u8D39\u8005\u6709\u81EA\u5DF1\u7684\u6D88\u8D39\u8005\u4F4D\u79FB\u3002</p><p>\u601D\u8003\uFF1A\u4E3A\u4EC0\u4E48Kafka\u4E0D\u50CFMySQL\u90A3\u6837\u5141\u8BB8\u8FFD\u968F\u8005\u526F\u672C\u5BF9\u5916\u63D0\u4F9B\u8BFB\u670D\u52A1\uFF1F</p><ol><li>\u4E3B\u4ECE\u8BFB\u5199\u5206\u79BB\u7684\u9002\u7528\u573A\u666F\u5E94\u8BE5\u662F\u90A3\u79CD\u8BFB\u64CD\u4F5C\u5F88\u591A\u800C\u5199\u64CD\u4F5C\u76F8\u5BF9\u4E0D\u9891\u7E41\u7684\u8D1F\u8F7D\u7C7B\u578B\uFF0C\u901A\u8FC7\u6DFB\u52A0\u5F88\u591A\u7684follower\u6A2A\u5411\u6269\u5C55\uFF0C\u63D0\u5347\u8BFB\u64CD\u4F5C\u6027\u80FD\u3002\u800CKafka\uFF0C\u5B83\u7684\u4E3B\u8981\u573A\u666F\u8FD8\u662F\u5728\u6D88\u606F\u5F15\u64CE\u800C\u4E0D\u662F\u4EE5\u6570\u636E\u5B58\u50A8\u7684\u65B9\u5F0F\u5BF9\u5916\u63D0\u4F9B\u8BFB\u670D\u52A1\uFF0C\u901A\u5E38\u6D89\u53CA\u9891\u7E41\u7684\u751F\u4EA7\u6D88\u606F\u548C\u6D88\u8D39\u6D88\u606F\uFF0C\u4E0D\u5C5E\u4E8E\u8BFB\u591A\u5199\u5C11\u7684\u573A\u666F\uFF0C\u56E0\u6B64\u8BFB\u5199\u5206\u79BB\u65B9\u6848\u5728\u8FD9\u4E2A\u573A\u666F\u4E0B\u5E76\u4E0D\u5408\u9002\u3002</li><li>Kafka\u526F\u672C\u673A\u5236\u4F7F\u7528\u7684\u662F\u5F02\u6B65\u6D88\u606F\u6765\u62C9\u53D6\uFF0C\u56E0\u6B64\u5B58\u5728leader\u548Cfollower\u4E4B\u95F4\u7684\u4E0D\u4E00\u81F4\u6027\u3002\u5982\u679C\u8981\u91C7\u7528\u8BFB\u5199\u5206\u79BB\uFF0C\u5FC5\u7136\u8981\u5904\u7406\u526F\u672C\u7684\u4E00\u81F4\u6027\u95EE\u9898\uFF0C\u589E\u52A0\u590D\u6742\u6027\u3002</li></ol><h3 id="kafka\u53C2\u6570\u914D\u7F6E" tabindex="-1"><a class="header-anchor" href="#kafka\u53C2\u6570\u914D\u7F6E" aria-hidden="true">#</a> Kafka\u53C2\u6570\u914D\u7F6E</h3><h3 id="\u751F\u4EA7\u8005\u6D88\u606F\u5206\u533A\u673A\u5236\u539F\u7406" tabindex="-1"><a class="header-anchor" href="#\u751F\u4EA7\u8005\u6D88\u606F\u5206\u533A\u673A\u5236\u539F\u7406" aria-hidden="true">#</a> \u751F\u4EA7\u8005\u6D88\u606F\u5206\u533A\u673A\u5236\u539F\u7406</h3><p>Kafka\u4F7F\u7528\u5206\u533A\u7684\u4F5C\u7528\u5C31\u662F\u63D0\u4F9B\u8D1F\u8F7D\u5747\u8861\u7684\u80FD\u529B\uFF0C\u5B9E\u73B0\u7CFB\u7EDF\u7684\u9AD8\u4F38\u7F29\u6027\u3002\u4E0D\u540C\u7684\u5206\u533A\u80FD\u591F\u88AB\u653E\u7F6E\u5728\u4E0D\u540C\u7684\u8282\u70B9\u673A\u5668\u4E0A\uFF0C\u800C\u6570\u636E\u7684\u8BFB\u5199\u64CD\u4F5C\u4E5F\u90FD\u662F\u9488\u5BF9\u5206\u533A\u8FD9\u4E2A\u7C92\u5EA6\u6765\u8FDB\u884C\u7684\uFF0C\u8FD9\u6837\u6BCF\u4E2A\u8282\u70B9\u7684\u673A\u5668\u90FD\u80FD\u72EC\u7ACB\u5730\u6267\u884C\u5404\u81EA\u5206\u533A\u7684\u8BFB\u5199\u8BF7\u6C42\u5904\u7406\u3002</p><p>\u5229\u7528\u5206\u533A\u4E5F\u53EF\u4EE5\u5B9E\u73B0\u4E1A\u52A1\u7EA7\u522B\u7684\u9700\u6C42\uFF0C\u6BD4\u5982\u5B9E\u73B0\u4E1A\u52A1\u7EA7\u522B\u7684\u6D88\u606F\u987A\u5E8F\u7684\u95EE\u9898\u3002</p><h4 id="\u5206\u533A\u7B56\u7565" tabindex="-1"><a class="header-anchor" href="#\u5206\u533A\u7B56\u7565" aria-hidden="true">#</a> \u5206\u533A\u7B56\u7565</h4><p>\u5206\u533A\u7B56\u7565\u5C31\u662F\u51B3\u5B9A\u751F\u4EA7\u8005\u5C06\u6D88\u606F\u53D1\u9001\u5230\u54EA\u4E2A\u5206\u533A\u7684\u7B97\u6CD5\u3002Kafka\u4E3A\u6211\u4EEC\u63D0\u4F9B\u4E86\u9ED8\u8BA4\u7684\u5206\u533A\u7B56\u7565\uFF0C\u540C\u65F6\u4E5F\u652F\u6301\u4F60\u81EA\u5B9A\u4E49\u5206\u533A\u7B56\u7565\u3002</p><h3 id="\u751F\u4EA7\u8005\u538B\u7F29\u7B97\u6CD5" tabindex="-1"><a class="header-anchor" href="#\u751F\u4EA7\u8005\u538B\u7F29\u7B97\u6CD5" aria-hidden="true">#</a> \u751F\u4EA7\u8005\u538B\u7F29\u7B97\u6CD5</h3>',31);function n(h,t){return i}var o=a(e,[["render",n],["__file","Kafka.html.vue"]]);export{o as default};
